import React from "react";

export function Attach() {
  return (
    <form>
      <div className="form-group row">
        <label for="file" className="col-sm-2 col-form-label">
          Attach File
        </label>
        <div className="col-sm-10">
          <input
            type="file"
            className="form-control"
            id="upload"
            name="upload"
          />
        </div>
      </div>
    </form>
  );
}
